import logo from './logo.svg';
import './App.css';
import DishList from './DsihList';
import Image from './image.jpg'
const sectionStyle = {
  backgroundImage: `url(${Image})`,
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  height: '100vh',  // Adjust height as needed
  position: 'relative',  // Ensure the container is positioned relative for absolute overlay
  filter: 'blur(5px)',  // Apply a 5px blur to the background image
};

const overlayStyle = {
  position: 'absolute',
  top: 0,
  left: 0,
  width: '100%',
  height: '100%',
  backgroundColor: 'rgba(0, 0, 0, 0.5)',  // Semi-transparent grey overlay
};

function App() {
  return (
    <div className="App" style={sectionStyle}>
      <div style={overlayStyle}></div>
      <DishList />
    </div>
  );
}

export default App;
